import React, { Component } from 'react'

import './content.less'
import {text} from '../../config/text'
const dataArr = text
export default class content extends Component {
    render() {
        return (
            <div className="content">
                <div>
                    <ul>
                        {
                          dataArr
                        }
                    </ul>
                </div>
            </div>
        )
    }
}
